// Header.js
import React from 'react';
import Typewriter from 'react-typewriter-effect';
import './Header.css'; // Import the CSS file for additional styling

const Header = () => {
  return (
    <header className="text-center py-8">
      <h1 className="text-4xl font-bold">
        <Typewriter
          options={{
            strings: ['on Track'],
            autoStart: true,
            loop: true,
            delay: 75, // Adjust the typing speed if needed
            onComplete: (typewriter) => {
              typewriter
                .changeDelay(500) // Delay before blinking
                .type('.')
                .remove('.')
                .type('.')
                .remove('.')
                .type('.')
                .remove('.')
                .type('.') // You can add/remove more blinking periods as needed
                .start();
            },
          }}
        />
      </h1>
    </header>
  );
};

export default Header;
